import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
  income: {
    borderRadius: "10px",
    boxShadow: "0 3px 6px rgba(0, 0, 0, 0.16), 0 3px 6px rgba(0, 0, 0, 0.23)",
  },
  expense: {
    borderRadius: "10px",
    boxShadow: "0 3px 6px rgba(0, 0, 0, 0.16), 0 3px 6px rgba(0, 0, 0, 0.23)",
  },
  saving: {
    borderRadius: "10px",
    boxShadow: "0 3px 6px rgba(0, 0, 0, 0.16), 0 3px 6px rgba(0, 0, 0, 0.23)",
  },
  overview: {
    borderRadius: "10px",
    boxShadow: "0 3px 6px rgba(0, 0, 0, 0.16), 0 3px 6px rgba(0, 0, 0, 0.23)",
  },
  chartContainer: {
    maxHeight: "400px",
  },
}));
